        // https://leetcode.com/problems/longest-unequal-adjacent-groups-subsequence-i
        public IList<string> GetLongestSubsequence(string[] words, int[] groups)
        {
            var list = new List<string> { words[0] };
            int last = groups[0];

            for (int i = 1; i < groups.Length; i++)
            {
                if (groups[i] != last)
                {
                    list.Add(words[i]);
                    last = groups[i];
                }
            }

            return list;
        }

